/** @jsxImportSource @emotion/react */
import { Cell, Grid } from "bold-ui";
import { css } from "@emotion/react";
import React from "react";

export function Navbar() {
  return (
    <Grid
      alignItems="center"
      direction="row"
      gap={2}
      gapVertical={4}
      justifyContent="center"
      style={gridStyles}
      wrap
    >
      <Cell>Home</Cell>
      <Cell>Login</Cell>
    </Grid>
  );
}

const gridStyles = css`
  width: 100%;
  padding: 0 !important;
  margin: 0 !important;
`;
